import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import View3d from './components/View3d';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'jquery';
import 'popper.js';
import 'bootstrap';


function App() {
    return (
        <Router>
            <div className="App">

                    <Routes>
                        <Route path="/" element={<View3d />} exact /> 
                    </Routes>

            </div>
        </Router>
    );
}

export default App;
